import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { FaRocket, FaCloud, FaShieldAlt, FaExpandArrowsAlt, FaBrain, FaCode, FaChartLine, FaCog } from 'react-icons/fa';

const FeatureCard = ({ title, description, icon: Icon, color }) => {
  const [isHovered, setIsHovered] = useState(false);
  return (
    <motion.div 
      className={`bg-gray-800 bg-opacity-50 p-4 rounded-lg backdrop-filter backdrop-blur-sm relative overflow-hidden`}
      whileHover={{ scale: 1.05, zIndex: 1 }}
      onHoverStart={() => setIsHovered(true)}
      onHoverEnd={() => setIsHovered(false)}
    >
      <Icon className={`w-6 h-6 ${color} absolute top-2 right-2`} />
      <h3 className="text-lg font-semibold text-white mb-2">{title}</h3>
      <p className="text-gray-300 text-sm">{description}</p>
      {isHovered && (
        <motion.div 
          className="absolute inset-0 bg-gradient-to-r from-indigo-500 to-purple-500 opacity-20"
          initial={{ opacity: 0 }}
          animate={{ opacity: 0.2 }}
        />
      )}
    </motion.div>
  );
};

const StatCard = ({ value, label, icon: Icon }) => (
  <motion.div 
    className="bg-gray-800 bg-opacity-50 p-4 rounded-lg text-center"
    whileHover={{ scale: 1.05 }}
  >
    <Icon className="w-8 h-8 text-indigo-400 mx-auto mb-2" />
    <div className="text-2xl font-bold text-white">{value}</div>
    <div className="text-sm text-gray-300">{label}</div>
  </motion.div>
);

const Info2 = () => {
  const features = [
    { title: "AI Integration", description: "Seamlessly integrate AI into your workflows", icon: FaBrain, color: "text-blue-400" },
    { title: "Cloud Optimization", description: "Optimize your infrastructure", icon: FaCloud, color: "text-purple-400" },
    { title: "Secure Development", description: "Build with security first", icon: FaShieldAlt, color: "text-green-400" },
    { title: "Scalable Architecture", description: "Design systems that grow", icon: FaExpandArrowsAlt, color: "text-pink-400" },
    { title: "Smart Coding", description: "Intelligent code suggestions", icon: FaCode, color: "text-yellow-400" },
    { title: "Performance Analytics", description: "In-depth performance insights", icon: FaChartLine, color: "text-red-400" },
  ];

  const stats = [
    { value: "99%", label: "Uptime", icon: FaRocket },
    { value: "24/7", label: "Support", icon: FaCog },
    { value: "50+", label: "Integrations", icon: FaExpandArrowsAlt },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-black text-white py-20 px-4 sm:px-6 lg:px-8 relative overflow-hidden">
      <div className="max-w-7xl mx-auto relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold mb-4 bg-clip-text text-transparent bg-gradient-to-r from-indigo-400 to-purple-500">
            Elevate Your Development Experience
          </h2>
          <p className="text-xl text-gray-300 max-w-3xl mx-auto">
            Discover how TokTok's innovative solutions can transform your software development process.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-8 mb-16">
          {features.map((feature, index) => (
            <FeatureCard key={index} {...feature} />
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          className="text-center"
        >
          <h3 className="text-2xl font-semibold mb-6">Ready to revolutionize your development process?</h3>
          <motion.button 
            className="bg-indigo-600 text-white px-8 py-3 rounded-md font-medium text-lg hover:bg-indigo-700 transition-colors"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            Start Your Journey
          </motion.button>
        </motion.div>
      </div>
    </div>
  );
};

export default Info2;
